Document: (CNN) -- "Budapest" rolls off the tongue pretty easily, and the Hungarian capital itself feels as if it's been around for a long time. But Budapest is a relatively recent construct -- the result of an 1873 merger between two distinct cities: Buda on the western bank of the Danube and Pest on the bank opposite. The result, Budapest, sounds so much more natural than other twin cities -- Minneapolis/St. Paul or Dallas/Fort Worth -- it's difficult to imagine that the alternative "Pestbuda" was floated seriously at the time. Although they've been populated for centuries, Pest and Buda have developed so separately that the first bridge spanning the Danube, the imposing Chain Bridge, wasn't built until 1849.
@highlight
Separated by the Danube, Pest and Buda became one city in 1873
@highlight
Budapest was almost called "Pestbuda"
@highlight
Hilly Buda has great views; Pest is flat but buzzing
@highlight
Even the thermal spas on each side have a different vibe 
In contrast, populous @placeholder -- as flat as a prairie -- is busy, buzzing and bourgeois, with an assortment of bars, cafés and gourmet restaurants.

(CNN)  -- Juventus named former club captain Antonio Conte as their new coach Tuesday in place of Luigi Delneri. The 41-year-old former Italian international has signed a two-year contract which ties him to the Turin giants until the end of June 2013. Juve officially announced Delneri's departure on their club website earlier in the day although the 60-year-old had revealed on the final weekend of the Serie A season he would be departing. It followed a difficult season in which the 'Old Lady' finished seventh in the standings for the second straight year and missed out on European qualification. Conte has a solid record as a coach, guiding Siena to promotion back to Serie A last season, a feat he had already achieved with Bari in 2009.
@highlight
Antonio Conte takes charge of Serie A giants Juventus
@highlight
Conte replaces Luigi Delneri after a second successive seventh place finish for Juve
@highlight
Former Italian international Conte played for Juventus for 13 years 
The same qualities that made him one of @placeholder's greatest ever winners," said a statement on the club's official website. 
