JERUSALEM (CNN) -- The U.N. Security Council failed to reach a consensus when it met to consider condemning an attack that killed eight people at a prominent Jewish seminary as an act of terrorism. Ambulance workers put one of the casualties from the seminary attack into an ambulance. The council said Libya -- a new, nonpermanent member -- blocked the statement on Thursday night. Ibrahim Dabbashi, Libya's deputy ambassador to the United Nations, said the attack on the school was no different than Israeli military offensives against militants in Gaza. But Dan Gillerman, Israel's ambassador to the United Nations, said he saw no connection between Thursday's shooting and Israel's operations in Gaza.
@highlight
