TEHRAN, Iran (CNN) -- Defying many predictions, Iranian President Mahmoud Ahmadinejad held a commanding lead in the presidential vote count early Saturday, election officials with Iran's Interior Ministry said. Men choose their candidates before voting Friday at a mosque in Tehran, Iran. With 72 percent of ballot boxes counted, Ahmedinejad had 65.7 percent of the vote while his chief rival Mir Hossein Moussavi had 31.4 percent, election officials said. Moussavi, widely regarded as a reformist, had been expected to do well as his campaign caught fire in recent days, triggering massive street rallies in Tehran. An "unprecedented" voter turnout at the polls Friday was also expected to boost Moussavi's chances of winning the presidency.
@highlight
