(CNN) -- A journalist who has criticized NBC's coverage of the London Olympics has been suspended from Twitter after using the site to publish a network executive's private e-mail address and urge followers to message him. Guy Adams, the Los Angeles correspondent for London's Independent newspaper, said he was tossed from the site Sunday after a series of posts, beginning Friday, that were critical of NBC's decision to delay airing the Games' Opening Ceremony and other events. "The man responsible for NBC pretending the Olympics haven't started yet is Gary Zenkel," read one post from Friday referring to the network, which has exclusive broadcast rights to the London Olympics in the United States. "Tell him what u think!" That post then listed Zenkel's e-mail address.
@highlight
